    public static string getxmlpar(string par, XmlNode node)
    {

        foreach (XmlNode xn in node.ChildNodes)
        {
            if (xn.Name == par)
            {
                string s = xn.InnerXml;
                if (s.Contains("<![CDATA["))
                {
                    s = s.Replace("<![CDATA[", "").Replace("]]>","");
                }
                else if (s.Contains("<![cdata["))
                {
                    s = s.Replace("<![cdata[", "").Replace("]]>", "");

                }
                return s;
            }


        }

        return "";
    }

