                int kk = namefound - 1;
                //Console.WriteLine("kk = " + kk.ToString());
                //while (parents[kk].Contains(incert))
                //{
                    //Console.WriteLine("Parentskk = " + parents[kk]);
                //    kk--;
                //}

                string parentname = parents[kk];
