    public static void list_taxa_with_region(int ntaxa)
    {
        int skip = 20000;
        int n = 0;
        Console.WriteLine("taxa with region = " + taxon_region.Count.ToString());
        foreach (int i in taxon_region.Keys)
        {
            n++;
            if (n % skip == 0)
                Console.WriteLine("taxon with region: " + taxondict[i].Name+"; "+taxon_region[i].Count.ToString());
            if (n > skip * ntaxa)
                break;
        }
    }

