        {
            if (!String.IsNullOrEmpty(taxondict[t].Name_sv))
                if (!swe_name.ContainsKey(t))
                    swe_name.Add(t, taxondict[t].Name_sv);
        }
        foreach (int t in swe_name.Keys)
        {
            if (!String.IsNullOrEmpty(swe_name[t]))
                if (String.IsNullOrEmpty(taxondict[t].Name_sv))
                    taxondict[t].Name_sv = swe_name[t].ToLower();
        }

        if ( regnum_to_make == "Fungi")
            fill_svampfakta();
        
        

        //list_taxa_with_region(20);

        bool maketreechart = false;
        if (maketreechart)
        {
            ptree.text += "\n\n==" + regnum_to_make + "==\n\n";
            printtree(taxotop[regnum_to_make], 1, 5);
            //printtree(get_name_id("Aves","",""),1,3);
            ptree.Save();
        }


        bool addsyn = false;

        if (addsyn)
        {
            oldtime = oldtime.AddSeconds(5);
            while (true)
            {
                Console.WriteLine("Taxon to add synonyms to:");
                string ss = initialcap(Console.ReadLine());
                int ssid = get_name_id(ss,"","");
                if (ssid > 0)
                {
                    itodo = 0;
                    countarticle(ssid);
                    Console.WriteLine(itodo.ToString() + " articles to do.");
                    idone = 0;
                    addsynonyms(ssid);
                    donetree.Add(ss);
                }

            }
        }

        bool removeothers = true;

        int rid = get_name_id("Chordata","","");
        //remove_tree(rid);

        
        if (removeothers)
        {
            Console.WriteLine("Remove trees");
            switch (regnum_to_make)
            {
                case "Plantae":
                    rid = get_name_id("Animalia", "", "");
                    remove_tree(rid);
                    rid = get_name_id("Fungi", "", "");
                    remove_tree(rid);
                    break;
                case "Animalia":
                    rid = get_name_id("Plantae", "", "");
                    remove_tree(rid);
                    rid = get_name_id("Fungi", "", "");
                    remove_tree(rid);
                    break;
                case "Fungi":
                    rid = get_name_id("Animalia", "", "");
                    remove_tree(rid);
                    rid = get_name_id("Plantae", "", "");
                    remove_tree(rid);
                    break;
            }


            Console.WriteLine("Garbage collection:");
            GC.Collect();
            Console.WriteLine("Removed trees");


        }

        Console.WriteLine("Regnum_to_make_sv: " + regnum_to_make_sv);

        oldtime = oldtime.AddSeconds(5);
        while (true)
        {
            Console.WriteLine("===================================================================");
            Console.WriteLine("===================================================================");
            Console.WriteLine("===================================================================");
            Console.WriteLine("Taxon to make:");
            string ss = initialcap(Console.ReadLine());
            taxon_to_make = ss;

            int ssid = get_name_id(ss, "", "");
            if ((ssid > 0) && (taxondict[ssid].regnum != regnum_to_make))
            {
                Console.WriteLine("Wrong regnum");
                ssid = -1;
            }
            if ( ssid <= 0)
            {
                XmlNode ssnode = getxmlfromname(ss);
                if (ssnode != null)
                    ssid = getxmlid(ssnode);
                Console.WriteLine("ssid = " + ssid.ToString());
            }
            if (ssid > 0)
            {
                if (latin_swe_name.ContainsKey(ss))
                    Console.WriteLine("Trivial name = " + latin_swe_name[ss]);
                else
                    Console.WriteLine("No trivial name");

                itodo = 0;
                istatus4 = 0;
                if (!dynonly)
                {
                    dynloop = false;
                    countarticle(ssid);
                }
                if (dynread)
                {
                    dynloop = true;
                    countarticle(ssid);
                }

                Console.WriteLine(itodo.ToString() + " articles to do.");
                Console.WriteLine(istatus4.ToString() + " articles with status provisionally accepted.");

                Console.Write("OK? (y/n)");
                string choice = Console.ReadLine();
                if (choice == "n")
                    continue;

                if (itodo > nskip)
                {
                    findcat(ssid);
                    Console.WriteLine("Syncat");
                    findsyncat(ssid);
                    if (makelang == "sv")
                    {
                        Console.WriteLine("Swecat");
                        findswecat(ssid);
                    }
                    Console.WriteLine("Cats done");
                }

                makesite.defaultEditComment = mp(60, null) + " " + taxon_to_make;

                
                idone = 0;
                dynloop = false;
                if ( !dynonly)
                    makearticle(ssid);//First make taxa in CoL-hierarchy...

                if (dynread)
                {
                    Console.WriteLine("====Dynloop!====");
                    dynloop = true;
                    makearticle(ssid);//... then in Dyntaxa-hierarchy.
                }

                donetree.Add(ss);

                Console.WriteLine(stats.GetStat());
                pstats.text += "\n\n== [[" + taxon_to_make + "]] ==\n\n";
                pstats.text += stats.GetStat();
                trysave(pstats, 1);
                stats.nart = 0;
                stats.nredirect = 0;
                stats.ncat = 0;
                stats.nbot = 0;
                stats.ntalk = 0;
                stats.sizelist.Clear();
            }
            
        }

	}
}

